INSERT INTO `section_detail` VALUES ('1025', '41', '24', 'HH19_Title', 'Title', 'T', '0', 'Check that the respondent is a knowledgeable member of the household and at least 18 years old before proceedings. You may only interview a child age 15-17 if there is no adult member of the household or all adults member are incapacitated. You may not interview a child under age 15. ', 'انٹرویو شروع کرنے سے پہلے اس بات کی یقین دہانی کرلیں کہ جواب دہندہ گھرانے کی مکمل معلومات رکھنے والا سمجھدار فرد ہے اور اس کی عمر کم از کم 18 سال ہے۔آپ صرف اس صورت میں15 سے 17 سال کی عمر  کے کسی بچے  کا انٹرویو کر سکتے ہیں اگر گھر میں کوئی بالغ فردموجود نہیں ہے یا گھر کے تمام    افراد معذور ہیں۔آپ 15 سال سے کم عمر بچے کا انٹرویو نہیں کر سکتے', '', '', '', null, null, '', '', 'Title', null, '', '', '', '', null, '23', '12', null, null, null, null, '');
INSERT INTO `section_detail` VALUES ('1026', '41', '24', 'HH19', 'Radio', 'T', '0', 'ASALUM-O-ALAIKUM, MY NAME IS (YOUR NAME). WE ARE FROM NATIONAL MINISTRY OF HEALTH SERVICES, REGULATION AND COORDINATION, GOVERNMENT OF PAKISTAN. WE ARE CONDUCTING A SURVEY ABOUT THE CHILDREN HEALTH IN PAKISTAN. I WOULD LIKE TO TALK TO YOU ABOUT VACCINATION OF CHILDREN 12-23 MONTHS AGE IN YOUR HOUSEHOLD. THIS INTERVIEW USUALLY TAKES ABOUT 30 MINUTES. ALL THE INFORMATION WE OBTAIN WILL REMAIN STRICTLY CONFIDENTIAL AND ANONYMOUS. YOUR VIEWS ARE VERY IMPORTANT FOR US. IF YOU WISH NOT TO ANSWER A QUESTION OR STOP THE INTERVIEW, PLEASE LET ME KNOW. MAY I START NOW?', 'اسلام وعلیکم، میرا نام(آپ کا نام)ہے۔ ہمارا تعلق  قومی ادارہ صحت، حکومت پاکستان سے ہے۔ہم پاکستان میں بچوں کی صحت کے حوالے سے ایک سروے کا انعقاد کررہے ہیں۔  میں آپ سے آپ کے گھر میں موجود 12 سے 23 مہینے کی عمر کے بچوںمیں حفاظتی ٹیکوں کی گزشتہ معلومات کے بارے میں بات کرنا چاہتا/چاہتی ہوں۔اس انٹرویو میں تقریباً 30منٹس لگیں گے۔ آپ سے حاصل کردہ تمام معلومات  مکمل طور پر خفیہ رہیں گی اور آپکا نام ظاہرنہیں کیا جائے گا۔ ۔ آپ کے خیالات ہمارے لئے بہت اہم ہیں۔اگر آپ کسی سوال کا جواب نہیں دینا چاہتے یا اس انٹرویوکو روکنا چاہتے  /چاہتی ہیں ، تو براہ کرم مجھے بتائیں۔ کیا میں اب انٹرویو شروع کر سکتی/سکتا ہوں؟', '', '', '', null, null, '', '', 'Radio', null, '', '', '', '', null, '23', '12', null, null, null, null, '');
