INSERT INTO `section_detail` VALUES ('7673', '105', '52', 'K101_title', 'Title', 'T', '0', 'Read aloud to the selected women of household: Now I would like to ask some questions about you, male head of household and your child.', 'منتخب کردہ گھر کی خاتون کو بلند آواز میں پڑھ کر سنائیں: اب میں آپ اور آپ کے گھر کے سربراہ، اورآپ کے بچے کے بارے میں کچھ سوال پوچھنا چاہوں گا۔', '', '', '', null, null, '', '', 'Title', null, '', '', '', '', null, '28', '16', 'N', '', '0', '0', '');
INSERT INTO `section_detail` VALUES ('7674', '99', '49', 'D901_SubA', 'Title', 'T', '0', '24-Hour Recall (on tablet) The recall should follow a standardized 24-hour recall multiple-pass format. The multiple-pass technique aims to reduce cognitive burden and improve reporting accuracy by encouraging respondents to report the foods that they consumed in stages, with increasing detail and opportunity to review and probe for potentially forgotten or misreported items.  1.	Please list all the food consumed yesterday 2.	Probe for foods that may have been missed (i.e. carbonated beverages, sweets, savory snacks, fruits, vegetables, breads). As well, probe to ask about additions to the food (i.e. salt, sugar, condiments etc.) 3.	Collect time and name of eating occasion for each food 4.	Using the measurement toolkit, collect detailed description and portion sizes of each food item.  5.	Final review of all foods in chronological order, with portion size.', 'یاددہانی کی بنیادایک معیاری 24 گھنٹوں کے مختلف اوقات کی یاداشت ملٹیپل-پاس پر مبنی ہونی چاہیے. ملٹیپل-پاس تکنیک کا مقصد یہ ہے کہ وہ معلومات دینے والے کے ذہنی بوجھ کوکم کرتاہےاوردرست معلومات دینے کے لیے جواب دہندہ کی حوصلہ افزائی کرتا ہے تاکہ وہ مختلف مراحل میں اپنی غذا کی کھپت کے بارے بغیرکسی بھول اور غلطی کے تفصیل بتا سکے۔  1.	براہ کرم کل کھائےگئے تمام کھانوں کے بارےمیں بتائیں 2.	تحقیقات کریں ان تمام کھانوں کے بارےمیں جو بتانے سے رہ گئے . (مثلا کاربونیٹیڈ مشروبات، مٹھائیاں، ہلکی پھلکی نمکین اور چٹپٹی اشیاء، پھل، سبزیاں، روٹی)اس کے ساتھ ساتھ، غذا میں استعمال ہونےوالی اضافی اشیاء کے بارے میں بھی تحقیق کرنے کے لئے پوچھاجائے(یعنی نمک، چینی، مصالہ جات وغیرہ) 3.	ہر کھانا کھانے کے اوقات اور کھانے کے مواقع کا نام حاصل کریں 4.	پیمائش کے ٹول کٹ کا استعمال کرتے ہوئے، ہر غذا کی تفصیل اورکھپت کردہ مقدار معلوم کریں. 5.	غذا کی تواريخ وارتفصیل اورکھپت کردہ مقدار حتمی جائزہ لیں', '', '', '', null, '0', '', 'D901_Sub', null, null, '', '', null, null, null, '28', '16', null, '', '', '', '');
